import Link from 'next/link';


const Nav = (props) => {
    const { route } = props;

    const navLocation = route => {
        if (route === "/") return "index";
        if (route === "/about") return "about";
        if (route === "/projects") return "projects";

    }




    return (

        <section className={`section__nav route-${navLocation}`}>
            <nav>


                <Link href="/">
                    <a>Home</a>
                </Link>
                <Link href="/about">
                    <a>About</a>
                </Link>

                <Link href="/projects">
                    <a>Projects</a>
                </Link>

            </nav>
        </section>

    )
}

export default Nav
